import React from "react";


const Contact = () => {



    return (
        <div className="contact-wrapper">
            <div className="contact">
                <p>Contact</p>
                <div className="links">
                    <div>Email: <a href="mailto:DavidJHennig@gmail.com">Send an email</a></div>
                    <br />
                    <div>LinkedIn: <a target="_blank" href="https://www.linkedin.com/in/davidhennig/">Connect on LinkedIn</a></div>
                    <br />
                    <div>Github: <a target="_blank" href="https://github.com/davidhennig">View my Github repositories</a></div>
                </div>
            </div>
        </div>
    )
}

export default Contact;
